import { React,useState, useEffect} from 'react';
import Grid from '@mui/material/Grid'
import axios from 'axios';


const stringifySafe = 
    require('json-stringify-safe');
//
//export const ItemListContainer : React.FC<FilterSearch> = (parameter) => { 
export const Elements = ({producto}) => {  

    const [itemlist,setItemList] = useState({});

    useEffect = (() => {
        async function fetchData() {
          alert('222');
            const response = await axios.get(`http://localhost:7000/externalapi/photos/${producto}`);

            if(response.status === 200) {
                const jsonOBJ = JSON.parse(stringifySafe(response.data));
                setItemList(  jsonOBJ["photo"]);
            }else{
                setItemList({});
            }

        }

        fetchData();

    },[itemlist])



    return (
        <div>


                    <h5>{itemlist.title}</h5>
                    <p>{itemlist.url}</p>
                    <div>
                        <h4>{itemlist.album.title}</h4>
                        <p>{itemlist.album.user.username}</p>
                    </div>

        </div>);
}
